//! `Matcher` is a struct that exposes an API tailored to the named character reference state of
//! HMTL tokenization. Underpinning it is a DAFSA that has been modified to improve performance
//! while keeping the data size low, and taking advantage of the fact that the named character
//! references table will not change at any point in the future.

const std = @import("std");
const builtin = @import("builtin");

const want_safety = builtin.mode == .Debug;

pub const Matcher = struct {
    search_state: SearchState = .init,
    last_matched_unique_index: u12 = 0,
    pending_unique_index: u12 = 0,
    /// This will be true if the last match ends with a semicolon
    ends_with_semicolon: bool = false,
    /// Note: The longest possible string of overconsumed characters is 31
    /// (corresponding to the longest named character reference &CounterClockwiseContourIntegral;),
    /// so that would fit into a `u5` but we use `u6` due to an implementation detail (incrementing
    /// `overconsumed_code_points` before checking for an end-of-word match).
    overconsumed_code_points: u6 = 0,

    const SearchState = union(enum) {
        init: void,
        first_to_second_layer: FirstToSecondLink,
        dafsa: []const Node,
    };

    pub const ConsumeResult = enum {
        consume_and_end,
        consume_and_continue,
        dont_consume_and_end,
    };

    pub fn tryConsumeCodePoint(self: *Matcher, c: u21) ConsumeResult {
        if (c > std.math.maxInt(u7)) return .dont_consume_and_end;
        return self.tryConsumeAsciiChar(@intCast(c));
    }

    pub fn tryConsumeByte(self: *Matcher, c: u8) ConsumeResult {
        if (c > std.math.maxInt(u7)) return .dont_consume_and_end;
        return self.tryConsumeAsciiChar(@intCast(c));
    }

    pub fn tryConsumeAsciiChar(self: *Matcher, c: u7) ConsumeResult {
        switch (self.search_state) {
            .init => {
                if (!std.ascii.isAlphabetic(c)) return .dont_consume_and_end;
                const index = asciiAlphabeticToIndex(c);
                const node = first_layer[index];
                self.search_state = .{ .first_to_second_layer = first_to_second_layer[index] };
                self.pending_unique_index = @intCast(node.number);
                self.overconsumed_code_points += 1;
                return .consume_and_continue;
            },
            .first_to_second_layer => |link| {
                if (!std.ascii.isAlphabetic(c)) return .dont_consume_and_end;
                const bit_index = asciiAlphabeticToIndex(c);
                if (@as(u52, 1) << bit_index & link.mask == 0) return .dont_consume_and_end;

                // Get the second layer node by re-using the link.mask.
                // For example, if the first character is 'n' and the second character is 'o':
                //
                // This is the link.mask when the first character is 'n':
                // 0001111110110110111111111100001000100000100001000000
                //            └ bit_index of 'o'
                //
                // Create a mask where all of the less significant bits than the bit index of
                // the current character ('o') are set:
                // 0000000000001111111111111111111111111111111111111111
                //            └ bit_index of 'o'
                //
                // Bitwise AND this new mask with the link.mask to get only the set bits less
                // significant than the bit index of the current character:
                // 0000000000000110111111111100001000100000100001000000
                //
                // Take the popcount of this to get the index of the node within the
                // second layer. In this case, there are 16 bits set, so the index
                // of 'o' in the second layer is link.second_layer_offset + 16.
                const mask = (@as(u52, 1) << bit_index) - 1;
                const char_index = @popCount(link.mask & mask);
                const node = second_layer.get(link.second_layer_offset + char_index);
                self.pending_unique_index += node.number;
                self.overconsumed_code_points += 1;
                if (node.end_of_word) {
                    self.pending_unique_index += 1;
                    self.last_matched_unique_index = self.pending_unique_index;
                    self.overconsumed_code_points = 0;
                    // Note: Two-letter named character references are limited to
                    // exactly &gt/&GT/&lt/&LT, so there's no possiblity of a
                    // semicolon in any two-letter named character references.
                }
                self.search_state = .{ .dafsa = dafsa[node.child_index..][0..node.children_len] };
                return .consume_and_continue;
            },
            .dafsa => |children| {
                for (children) |node| {
                    if (node.char == c) {
                        self.pending_unique_index += node.number;
                        self.overconsumed_code_points += 1;
                        if (node.end_of_word) {
                            self.pending_unique_index += 1;
                            self.last_matched_unique_index = self.pending_unique_index;
                            self.ends_with_semicolon = c == ';';
                            self.overconsumed_code_points = 0;
                            if (self.ends_with_semicolon) return .consume_and_end;
                        }
                        self.search_state.dafsa = dafsa[node.child_index..][0..node.children_len];
                        // There are no named character references without semicolons that are not
                        // substrings of the same named character reference with a semicolon, so
                        // we know at this point that a longer named character reference is possible.
                        std.debug.assert(node.children_len > 0);
                        return .consume_and_continue;
                    }
                }
                return .dont_consume_and_end;
            },
        }
    }

    fn asciiAlphabeticToIndex(c: u7) u6 {
        if (comptime want_safety) std.debug.assert(std.ascii.isAlphabetic(c));
        return if (c <= 'Z') @intCast(c - 'A') else @intCast(c - 'a' + 26);
    }

    /// Returns the `Codepoints` associated with the last match, if any.
    pub fn getCodepoints(self: Matcher) ?Codepoints {
        if (self.last_matched_unique_index == 0) return null;
        return codepoints_lookup.get(self.last_matched_unique_index - 1);
    }
};

test Matcher {
    var matcher = Matcher{};

    // Note: CodePoint/Byte/AsciiChar variants are intermixed here since they should
    // all behave the same.

    // 'n' can still match something
    try std.testing.expectEqual(.consume_and_continue, matcher.tryConsumeCodePoint('n'));
    try std.testing.expectEqual(0, matcher.last_matched_unique_index);

    // 'no' can still match something
    try std.testing.expectEqual(.consume_and_continue, matcher.tryConsumeByte('o'));
    try std.testing.expectEqual(0, matcher.last_matched_unique_index);

    // 'not' matches fully
    try std.testing.expectEqual(.consume_and_continue, matcher.tryConsumeAsciiChar('t'));
    try std.testing.expect(matcher.last_matched_unique_index != 0);
    const not_unique_index = matcher.last_matched_unique_index;

    {
        // Copy matcher and test that &not; leads to .consume_and_end
        var complete_matcher = matcher;
        try std.testing.expectEqual(.consume_and_end, complete_matcher.tryConsumeAsciiChar(';'));
    }

    // 'noti' can still match something, but 'not' is still the last full match
    try std.testing.expectEqual(.consume_and_continue, matcher.tryConsumeAsciiChar('i'));
    try std.testing.expectEqual(not_unique_index, matcher.last_matched_unique_index);

    // 'noti!' can no longer match anything, and 'not' is still the last full match
    try std.testing.expectEqual(.dont_consume_and_end, matcher.tryConsumeAsciiChar('!'));
    try std.testing.expectEqual(not_unique_index, matcher.last_matched_unique_index);
}

pub const Node = packed struct(u32) {
    /// Note: The actual alphabet of characters used in the list of named character references only
    /// includes 61 unique characters ('1'...'8', ';', 'a'...'z', 'A'...'Z').
    char: u8,
    /// Typically, nodes are numbered with "an integer which gives the number of words that
    /// would be accepted by the automaton starting from that state." This numbering
    /// allows calculating "a one-to-one correspondence between the integers 1 to L
    /// (L is the number of words accepted by the automaton) and the words themselves."
    ///
    /// This allows us to have a minimal perfect hashing scheme such that it's possible to store
    /// and lookup the codepoint transformations of each named character reference using a separate
    /// array.
    ///
    /// This uses that idea, but instead of storing a per-node number that gets built up while
    /// searching a list of children, the cumulative number that would result from adding together
    /// the numbers of all the previous sibling nodes is stored instead. This cuts down on a bit
    /// of work done while searching while keeping the minimal perfect hashing strategy intact.
    ///
    /// Empirically, the largest number in our DAFSA is 51, so all number values could fit in a u6.
    number: u7,
    /// If true, this node is the end of a valid named character reference.
    /// Note: This does not necessarily mean that this node does not have child nodes.
    end_of_word: bool,
    /// Number of children
    children_len: u4,
    /// Index of the first child of this node.
    /// There are 3190 nodes in our DAFSA after the first and second layers were extracted out, so
    /// all indexes can fit in a u12 (there would be 3872 nodes with the first/second layers
    /// included, so still a u12).
    child_index: u12,
};

const FirstLayerNode = packed struct {
    number: u16, // could be u12
};

const FirstToSecondLink = packed struct {
    mask: u52,
    second_layer_offset: u12,
};

const SecondLayerNode = packed struct(u24) {
    number: u8,
    child_index: u10,
    children_len: u5, // could be u4
    end_of_word: bool,
};

/// There are only 8 possible codepoints that appear as the second codepoint of a
/// named character reference (plus the most common option of no second codepoint).
/// The 8 possible codepoints can be encoded as a u3, but we use u4 to encode the
/// 'no second codepoint' option in this enum as well.
pub const SecondCodepoint = enum(u4) {
    none,
    combining_long_solidus_overlay, // U+0338
    combining_long_vertical_line_overlay, // U+20D2
    hair_space, // U+200A
    combining_double_low_line, // U+0333
    combining_reverse_solidus_overlay, // U+20E5
    variation_selector_1, // U+FE00
    latin_small_letter_j, // U+006A
    combining_macron_below, // U+0331

    pub fn asInt(self: SecondCodepoint) ?u16 {
        return switch (self) {
            .none => null,
            .combining_long_solidus_overlay => '\u{0338}',
            .combining_long_vertical_line_overlay => '\u{20D2}',
            .hair_space => '\u{200A}',
            .combining_double_low_line => '\u{0333}',
            .combining_reverse_solidus_overlay => '\u{20E5}',
            .variation_selector_1 => '\u{FE00}',
            .latin_small_letter_j => '\u{006A}',
            .combining_macron_below => '\u{0331}',
        };
    }
};

pub const Codepoints = packed struct(u21) {
    first: u17, // Largest value is U+1D56B
    second: SecondCodepoint = .none,
};

/// Without using a packed array, [2231]Codepoints would take up 8,924 bytes since @alignOf(Codepoints) is 4,
/// so by using a packed array we save 3,067 bytes. The increased runtime cost of accessing elements in the packed
/// array should not cause any issues since it is only used after we *know* we have a match, so exactly one element
/// in the `codepoints_lookup` will be accessed per named character reference.
///
/// To avoid the comptime cost of packing 2231 `u21`s into [5857]u8, we have done that packing once
/// and then dumped out the [5857]u8 as a string literal, which is what's provided to the bytes
/// field here.
///
/// Because we are providing the [5857]u8 directly, its endianness is fixed (and happens to be little-endian).
